function readheader(header) {
  let layers = header.split(/[ -]/);
  // console.log(layers);
  let result = [1, 1, 1];
  let out = Number(layers[3]);
  result[2] = out;
  let hid = Number(layers[2]);
  result[1] = hid;
  // result[0] = new Array(hid);
  let elements = layers[1].split('+');
  // console.log(elements);
  let input = elements.map(Number);
  result[0] = input;
  // console.log(result);
  return result;
}

function parse(txt, layers) {
  let result = '';
  weights = txt.split(',').map(Number);
  // console.log(weights.length);
  // console.log((64 + 2 + 1 + 1) * 8 + 8 + 1);
  let i = 0;
  // cells
  for (let l = 0 ; l < layers[1] ; ++l) {
    for (let y = 0 ; y < 8 ; ++y) {
      let line = '|';
      for (let x = 0 ; x < 8 ; ++x) {
        line += weights[x * 8 + y + i].toFixed(1) + '|';
      }
      result += line + '<br>';
    }
    result += '<br>';
    i += layers[0][0];
  }
  result += '|';
  // turn
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += weights[l + i].toFixed(1) + '|';
    i += layers[0][1];
  }
  result += '<br><br>';
  // fixed stone
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + weights[i].toFixed(1) + '|';
    result += weights[i + 1].toFixed(1) + '|<br>';
    i += layers[0][2];
  }
  result += '<br>';
  // bias
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + weights[i].toFixed(1);
    ++i;
  }
  result += '|<br><br>';
  // hidden
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + weights[i].toFixed(1);
    ++i;
  }
  // bias
  result += '|<br><br>|' + weights[i].toFixed(1) + '|<br>';
  return result;
}

const levelp = ["・", "ｏ", "○", "Ｏ", "◯", "◎", "🟡", "🟠", "🔴"];
const zero = "　"
const levelm = ["一", "二", "三", "井", "％", "※", "🟢", "🔵", "🟣"];

function num2markLog(n) {
  let nn = Math.abs(n)
  if (nn < 1) return zero;

  let i = Math.round(Math.log(nn));
  if (i >= levelp.length - 1) i = levelp.length - 1;
  if (n > 0) return levelp[i];
  return levelm[i];
}

function num2markLog2(n) {
  let nn = Math.abs(n)
  if (nn < 1) return "<font color='white'>■</font>";

  let i = Math.round(Math.log10(nn) * 64);
  if (i > 255) {i = 255;}
  i = 255 - i;
  let val = i.toString(16);
  if (val.length == 1) {val = "0" + val;}
  val += val;
  if (n > 0) return "<font color='#ff" + val + "'>■</font>";
  return "<font color='#" + val + "ff'>■</font>";
}

function bluewhitered(nn, i) {
  if (nn < 1) return 'ffff';
 
  i = 255 - i;
  let val = i.toString(16);
  if (val.length == 1) {val = "0" + val;}
  val += val;
  return val;
}

function cool2warm(i) {
  if (i < 0) return tblcool2warm[0];
  if (i > 255) return tblcool2warm[255];
  return tblcool2warm[i];
}

/* yellow - purple */
function viridis(i) {
  if (i < 0) return tblviridis[0];
  if (i > 255) return tblviridis[255];
  return tblviridis[i];
}

function num2markLn(n) {
  let nn = Math.abs(n * 2.71828182846);
  if (nn < 1) return "<font color='white'>■</font>";
  /* blue - white - red *
  let i = Math.round(Math.log(nn) * 64);
  if (i > 255) {i = 255;}
  let val = bluewhitered(nn, i);
  if (n > 0) return "<font color='#ff" + val + "'>■</font>";

  return "<font color='#" + val + "ff'>■</font>";*/

  /* viridis */
  let i = Math.round(Math.log(nn) * 32);
  if (n < 0) i = -i;
  i += 128;
  let val = cool2warm(i);//viridis(i);
  return "<span style='color:rgb(" + val + ")'>■</span>";
}

function num2marklinear(n) {
  let nn = Math.abs(n)
  if (nn < 1) return zero;

  let i = Math.round(nn / 20.0);
  if (i >= levelp.length - 1) i = levelp.length - 1;
  if (n > 0) return levelp[i];
  return levelm[i];
}

function num2txt(n) {
  return n.toFixed(2);
}

function parseascii(txt, layers, converter) {
  let result = '';
  weights = txt.split(',').map(Number);
  let i = 0;

  for (let l = 0 ; l < layers[1] ; ++l) {
    result += "|   |   |   |   |   |   |   |   |\n|---|---|---|---|---|---|---|---|\n";
    for (let y = 0 ; y < 8 ; ++y) {
      let line = ''
      for (let x = 0 ; x < 8 ; ++x) {
        line += '|' + converter(weights[x * 8 + y + i]);
      }
      result += line + '|\n';
    }
    result += '\n\n\n';
    i += layers[0][0];
  }
  let tmp = '|\n';
  let ali = '|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[l + i]);
    i += layers[0][1];
  }
  result += ali + tmp + '|\n\n\n';
  result += '|   |   |\n|---|---|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|' + converter(weights[i]) + '|'
        + converter(weights[i + 1]) + '|\n';
    i += layers[0][2];
  }
  result += '\n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    i += 1;
  }
  result += ali + tmp + '|\n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    i += 1;
  }
  result += ali + tmp + '|\n\n';
  result += converter(weights[i]) + '<br>';
  return result;
}

function parseasciitbl(txt, layers, converter) {
  let result = '';
  weights = txt.split(',').map(Number);
  let i = 0;

  result += '<div class="grp">';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += "<table border=1 cellspacing=0><caption>cell:" + l + "</caption>";
    for (let y = 0 ; y < 8 ; ++y) {
      let line = '<tr>'
      for (let x = 0 ; x < 8 ; ++x) {
        line += '<td>' + converter(weights[x * 8 + y + i]) + '</td>';
      }
      result += line + '</tr>';
    }
    result += '</table>\n';
    i += layers[0][0];
  }
  result += '</div>';
  result += '<table border=1 cellspacing=0><caption>turn</caption>';
  let sz = layers[1]
  for (let l = sz ; l > 0 ; ) {
    const COLUMNS = 256;
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[l + i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<table border=1 cellspacing=0><caption>fixed stones</caption><tr>';
  let tmp = '</tr><tr>'
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    tmp += '<td>' + converter(weights[i + 1]) + '</td>';
    i += layers[0][2];
  }
  result += tmp + '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>bias</caption>';
  for (let l = sz ; l > 0 ; ) {
    const COLUMNS = 256;
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[l + i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<table border=1 cellspacing=0><caption>hidden</caption><tr>';
  for (let l = 0 ; l < layers[1] ; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    i += 1;
  }
  result += '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>bias</caption><tr><td>'
      + converter(weights[i]) + '</td></tr></table>\n';
  return result;
}

function runnum() {
  let txt = document.getElementById('input').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output');
  let layers = readheader(txt[0]);
  out.innerHTML = parse(txt[1], layers);
}

function runasc(type) {
  let txt = document.getElementById('input').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output');
  let layers = readheader(txt[0]);
  // out.innerHTML = parseascii(txt[1], layers);
  if (type == "linear") {
    out.innerHTML = markdown.parse(parseascii(txt[1], layers, num2marklinear));
  } else if (type == "log10") {
    // out.innerHTML = markdown.parse(parseasciitbl(txt[1], layers, num2markLog2));
    out.innerHTML = parseasciitbl(txt[1], layers, num2markLog2);
  } else if (type == "logE") {
    // out.innerHTML = markdown.parse(parseasciitbl(txt[1], layers, num2markLn));
    out.innerHTML = parseasciitbl(txt[1], layers, num2markLn);
  }
}

function parseascii2(txt, layers, converter) {
  let result = 'cells  \n\n';
  weights = txt.split(',').map(Number);
  let i = 0;

  for (let l = 0; l < layers[1]; ++l) {
    result += "|   |   |   |   |   |   |   |   |\n|---|---|---|---|---|---|---|---|\n";
    for (let y = 0; y < 8; ++y) {
      let line = ''
      for (let x = 0; x < 8; ++x) {
        line += '|' + converter(weights[x * 8 + y + i]);
      }
      result += line + '|\n';
    }
    result += '\n\n\n';
    i += layers[0][0];
  }
  result += 'turn  \n\n';
  let tmp = '|\n';
  let ali = '|\n';
  for (let l = 0; l < layers[1]; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[l + i]);
    i += layers[0][1];
  }
  result += ali + tmp + '|\n\n\n';
  result += 'fixed stones black  \n\n|';
  let header = '';
  let row = '\n|';
  for (let l = 0; l < layers[1]; ++l) {
    header += '   |';
    row += '---|';
  }
  result += header + row + '\n';
  for (let l = 0; l < layers[1]; ++l) {
    result += converter(weights[i]) + '|';
    ++i;
  }
  result += '|\n\nfixed stones white  \n\n|';
  result += header + row + '\n';
  for (let l = 0; l < layers[1]; ++l) {
    result += converter(weights[i + 1]) + '|';
    ++i;
  }
  result += '|\n\nbias  \n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0; l < layers[1]; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    ++i;
  }
  result += ali + tmp + '|\n\n';
  result += 'hidden1  \n\n';
  for (let k = 0; k < layers[2]; ++k) {
    let tmp = '|\n';
    let ali = '|\n';
    for (let l = 0; l < layers[1]; ++l) {
      result += '|   ';
      ali += '|---';
      tmp += '|' + converter(weights[l + i]);
    }
    i += layers[1];
    result += ali + tmp + '|\n\n';
  }
  result += 'hidden1-bias  \n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0; l < layers[2]; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    ++i;
  }
  result += ali + tmp + '|\n\n';

  result += 'hidden2  \n\n';
  tmp = '|\n';
  ali = '|\n';
  for (let l = 0; l < layers[2]; ++l) {
    result += '|   ';
    ali += '|---';
    tmp += '|' + converter(weights[i]);
    ++i;
  }
  result += ali + tmp + '|\n\n';

  result += 'hidden2-bias  \n\n';
  result += converter(weights[i]) + '<br>';

  return result;
}

function parseasciitbl2(txt, layers, converter) {
  let result = '';
  weights = txt.split(',').map(Number);
  let i = 0;

  result += '<div class="grp">';
  for (let l = 0; l < layers[1]; ++l) {
    result += "<table border=1 cellspacing=0><caption>cell:" + l + "</caption>";
    for (let y = 0; y < 8; ++y) {
      let line = '<tr>'
      for (let x = 0; x < 8; ++x) {
        line += '<td>' + converter(weights[x * 8 + y + i]) + '</td>';
      }
      result += line + '</tr>';
    }
    result += '</table>\n';
    i += layers[0][0];
  }
  result += '</div>';
  result += '<table border=1 cellspacing=0><caption>turn</caption><tr>';
  let sz = layers[1]
  const COLUMNS = 128;
  for (let l = sz ; l > 0 ; ) {
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<table border=1 cellspacing=0><caption>fixed stones black</caption>';
  for (let l = sz ; l > 0 ; ) {
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<table border=1 cellspacing=0><caption>fixed stones white</caption>';
  for (let l = sz ; l > 0 ; ) {
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<table border=1 cellspacing=0><caption>bias</caption>';
  for (let l = sz ; l > 0 ; ) {
    let sz2 = l >= COLUMNS ? COLUMNS : l;
    l -= COLUMNS;
    result += '<tr>';
    for (let m = 0 ; m < sz2 ; ++m) {
      result += '<td>' + converter(weights[i]) + '</td>';
      ++i;
    }
    result += '</tr>';
  }
  result += '</table>\n';
  result += '<div class="grp">';
  for (let k = 0; k < layers[2]; ++k) {
    result += "<table border=1 cellspacing=0><caption>hidden1-" + k + "</caption>";
    for (let l = 0; l < 4; ++l) {
      result += '<tr>';
      for (let m = 0; m < layers[1] / 4; ++m) {
        result += '<td>' + converter(weights[i]) + '</td>';
        ++i;
      }
      result += '</tr>';
    }
    result += '</table>\n';
  }
  result += '</div>';

  result += '<table border=1 cellspacing=0><caption>hidden1-bias</caption><tr>';
  for (let l = 0; l < layers[2]; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    ++i;
  }
  result += '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>hidden2</caption><tr>';
  for (let l = 0; l < layers[2]; ++l) {
    result += '<td>' + converter(weights[i]) + '</td>';
    ++i;
  }
  result += '</tr></table>\n';
  result += '<table border=1 cellspacing=0><caption>hidden2-bias</caption><tr><td>'
      + converter(weights[i]) + '</td></tr></table>\n';
  return result;
}

function runasc2(type) {
  let txt = document.getElementById('input2').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output2');
  let layers = readheader2(txt[0]);
  // out.innerHTML = parseascii(txt[1], layers);
  if (type == "linear") {
    out.innerHTML =
        /*markdown.parse(parseascii2(txt[1], layers, num2txt));*/
        markdown.parse(parseascii2(txt[1], layers, num2marklinear));
  } else if (type == "log10") {
    // out.innerHTML = markdown.parse(parseasciitbl(txt[1], layers, num2markLog2));
    out.innerHTML = parseasciitbl2(txt[1], layers, num2markLog2);
  } else if (type == "logE") {
    // out.innerHTML = markdown.parse(parseasciitbl(txt[1], layers, num2markLn));
    out.innerHTML = parseasciitbl2(txt[1], layers, num2markLn);
  }
}

/* -- -- --  v0.4.* -- -- -- */

// ex. # 3x 64+1+2-128-16-1
function readheader4(header) {
  let layers = header.split(/[ -]/);
  // console.log(layers);
  let sets_x = layers[1];  // "3x"
  let sets = sets_x[0] - 0;

  let result = [1, 1, 1, 1, 1];
  let out = Number(layers[5]);
  result[4] = out;
  let hid2 = Number(layers[4]);
  result[3] = hid2;
  let hid1 = Number(layers[3]);
  result[2] = hid1;
  // result[1] = new Array(hid);
  let elements = layers[2].split('+');
  // console.log(elements);
  let input = elements.map(Number);
  result[1] = input;
  result[0] = sets;
  // console.log(result);
  return result;
}

function parse4(txt, layers) {
  let result = '';
  for (let iset = 1; iset <= layers[0]; ++iset) {
    result += "# part: " + iset + "<br>";

    weights = txt[iset].split(',').map(Number);

    let i = 0;
    // cells
    for (let l = 0; l < layers[2]; ++l) {
      for (let y = 0; y < 8; ++y) {
        let line = '|';
        for (let x = 0; x < 8; ++x) {
          line += weights[x * 8 + y + i].toFixed(2) + '|';
        }
        result += line + '<br>';
      }
      result += '<br>';
      i += layers[1][0];
    }
    result += '|';
    // turn
    for (let l = 0; l < layers[2]; ++l) {
      result += weights[l + i].toFixed(2) + '|';
      i += layers[1][1];
    }
    result += '<br><br>|';
    // fixed stone
    for (let l = 0; l < layers[2]; ++l) {
      result += weights[i].toFixed(2) + '|';
      ++i;
    }
    result += '<br>|';
    for (let l = 0; l < layers[2]; ++l) {
      result += weights[i].toFixed(2) + '|';
      ++i;
    }
    result += '<br><br>';
    // bias
    for (let l = 0; l < layers[2]; ++l) {
      result += '|' + weights[i].toFixed(2);
      ++i;
    }
    result += '|<br><br>';
    // hidden1
    for (let k = 0; k < layers[3]; ++k) {
      let line = '|';
      for (let l = 0; l < layers[2]; ++l) {
        line += weights[i].toFixed(2) + '|';
        ++i;
      }
      result += line + '<br><br>';
    }
    // bias1
    for (let k = 0; k < layers[3]; ++k) {
      result += '|' + weights[i].toFixed(2);
      ++i;
    }
    result += '|<br><br>';
    // hidden2
    for (let l = 0; l < layers[3]; ++l) {
      result += '|' + weights[i].toFixed(2);
      ++i;
    }
    // bias2
    result += '|<br><br>|' + weights[i].toFixed(2) + '|<br><br>';
  }

  return result;
}

function runnum4() {
  let txt = document.getElementById('input4').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output4');
  let layers = readheader4(txt[0]);
  out.innerHTML = parse4(txt, layers);
}

function runasc4(type) {
  let txt = document.getElementById('input4').value.split('\n');
  // console.log(txt);
  let out = document.getElementById('output4');
  let layers = readheader4(txt[0]);
  let n2mk;
  if (type == "linear") {
    n2mk = num2marklinear;
  } else if (type == "log10") {
    n2mk = num2markLog2;
  } else if (type == "logE") {
    n2mk = num2markLn;
  }

  let inner_layers = [...layers];
  inner_layers.shift();

  let result = "";
  for (let iset = 1; iset <= layers[0]; ++iset) {
    result += "<h1>part:" + iset + "</h1>";
    if (type == "linear") {
      result += markdown.parse(parseascii2(txt[iset], inner_layers, n2mk));
    } else {
      result += parseasciitbl2(txt[iset], inner_layers, n2mk);
    }
  }
  out.innerHTML = result;
}

function pasteText(txtarea) {
  let ta = document.getElementById(txtarea);
  if(navigator.clipboard){
    navigator.clipboard.readText()
      .then(function(text){
        ta.textContent = text;
    });
    return;
  }

  ta.execCommand("paste");
}
